import React from "react";
import { Button } from "semantic-ui-react";

const registerRestaurant=() => {

    return(
        <div class="container">
            <h4>Formulario de Registro de Restaurante</h4>
            <p>hola mundo</p>
    <form id="miFormulario" action="" method="get" onsubmit="return valida(this)">
    <input name="archivo" id="archivo" type="file"></input>
  <input type="submit" value="Cargar" name="crear" ></input>
    </form>

            
        </div> 
    ) 
}

 function valida(f) {
  var ok = true;
  var msg = "Debes escribir contenido en los campos:\n";
  if(f.elements[0].value == "")
  {
    msg += "- Marca 1\n";
    ok = false;
  }

  if(f.elements["marca2"].value == "")
  {
    msg += "- Marca 2\n";
    ok = false;
  }

  if(f.marca3.value == "")
  {
    msg += "- Marca 3\n";
    ok = false;
  }

  if(ok == false)
    alert(msg);
  return ok;
}



export default registerRestaurant
